export default function Cabecalho(props){
    return(
            <header>
                <img src='../../..image/menu.png'/>
                <img src='../../../image/logoAdmin.png'></img>
                <input></input>
                <button><img src="../../../image/lupa.png"></img></button>
                <img src='../../../image/favoritos.png'></img>
                <img src='../../../image/user.png'></img>
                <img src='../../../image/sacola.png'></img>
            </header>
        )
}
